import './index.css';
import React from "react"
import ReactDOM from 'react-dom';
import App from './App';
import Headings from './Headings'
import { Container, Row } from 'reactstrap';
// import 'bootstrap/dist/css/bootstrap.min.css';

ReactDOM.render(
    <Container>
      <Row><Headings/></Row>
      <Row><App/></Row>
    </Container>,
    document.getElementById('root')
);
